import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to trigger the view toggle buttons
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'phone');
    await page.click('.search-btn');

    // Wait for search results and view toggle to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Switch to list view mode
    await page.click('button[title="List View"]');

    // Verify the view has changed by checking for list view specific classes
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Extract data to verify the switch was successful
    const viewMode = await page.$eval('.view-toggle .active', el => el.title);
    const productContainerClass = await page.$eval('[class*="products-"]', el => el.className);

    return {
      success: true,
      action: "Switched to List View Mode successfully",
      extractedData: {
        currentViewMode: viewMode,
        productContainerClass: productContainerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
